              <Nav.Link style={{color:"grey"}} href="/">Home</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link style={{color:"grey"}} href="/">Home</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link style={{color:"grey"}} href="/">Home</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link style={{color:"grey"}} href="/">Home</Nav.Link>
            </Nav.Item>
          </Nav>
        </Navbar>
      </Container>
    );
  }
}


export default App;
